/**
 * Generador de Voucher Térmico para Impresora de 58mm
 * Formato optimizado para impresoras de tickets (POS thermal printers)
 */

// Logo de MPF en base64 (se insertará dinámicamente)
const MPF_LOGO_BASE64 = "data:image/jpeg;base64,";

/**
 * Genera un voucher HTML optimizado para impresora térmica de 58mm
 * @param {Object} params - Parámetros del voucher
 * @returns {string} HTML del voucher listo para imprimir
 */
export function generateThermalVoucher({ 
  reportData, 
  projectName, 
  machineInfo, 
  operadorInfo,
  empresaInfo,
  repartidorInfo,
  equipoSurtidorInfo,
  numeroGuiaCorrelativo
}) {
  // Usar número de guía correlativo o generar uno basado en el reporte
  const numeroGuia = numeroGuiaCorrelativo 
    ? numeroGuiaCorrelativo.toString().padStart(3, '0')
    : (reportData.numeroReporte ? reportData.numeroReporte.split('-').pop() : '001');


  // Formatear RUN con separador de puntos
  const formatRun = (run) => {
    if (!run) return 'N/A';
    // Remover puntos y guiones existentes
    const cleaned = run.replace(/\./g, '').replace(/-/g, '');
    // Si tiene más de 1 caracter
    if (cleaned.length > 1) {
      const dv = cleaned.slice(-1);
      const numero = cleaned.slice(0, -1);
      // Agregar puntos cada 3 dígitos de derecha a izquierda
      const formatted = numero.replace(/\B(?=(\d{3})+(?!\d))/g, '.');
      return `${formatted}-${dv}`;
    }
    return run;
  };

  // Extraer primer nombre y primer apellido
  const formatNombreCorto = (nombreCompleto) => {
    if (!nombreCompleto) return 'N/A';
    const partes = nombreCompleto.trim().split(/\s+/);
    if (partes.length === 1) return partes[0];
    if (partes.length === 2) return nombreCompleto;
    // Primer nombre + primer apellido
    return `${partes[0]} ${partes[1]}`;
  };

    // Formatear fecha
  const formatDate = (dateStr) => {
    try {
      const [year, month, day] = dateStr.split('-');
      return `${day}/${month}/${year}`;
    } catch (e) {
      return dateStr;
    }
  };

  // Formatear cantidad con separador de miles
  const formatCantidad = (cantidad) => {
    if (!cantidad) return '0';
    const num = parseFloat(cantidad);
    return num.toLocaleString('es-CL', { 
      minimumFractionDigits: 0,
      maximumFractionDigits: 2 
    });
  };

  // Formatear hora
  const hora = reportData.hora || new Date().toLocaleTimeString('es-CL', { 
    hour: '2-digit', 
    minute: '2-digit',
    hour12: false 
  });

  const fechaFormateada = formatDate(reportData.fecha || '');
  const cantidadFormateada = formatCantidad(reportData.cantidadLitros);

  // Generar sección de firmas
  const firmaReceptorImg = reportData.firmaReceptor || null;
  const firmaLineaHTML = firmaReceptorImg
    ? `<img src="${firmaReceptorImg}" class="firma-img" alt="Firma receptor" />`
    : `<div class="firma-line"></div>`;

  const firmasSectionHTML = `
    <!-- FIRMA RECEPTOR -->
    <div class="firma-section-single">
      <div class="firma-box">
        ${firmaLineaHTML}
        <div class="small firma-label">FIRMA</div>
        <div class="small firma-rol">RECEPTOR</div>
      </div>
    </div>
    `;

  // Generar HTML del voucher
  const voucherHTML = `
<!DOCTYPE html>
<html>
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Voucher - ${numeroGuia}</title>
  <style>
    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }
    
    @page {
      size: 58mm auto;
      margin: 0;
    }
    
    body {
      width: 58mm;
      font-family: 'Courier New', Courier, monospace;
      font-size: 9pt;
      line-height: 1.3;
      padding: 2mm;
      background: white;
      color: black;
    }
    
    .voucher {
      width: 100%;
    }
    
    .center {
      text-align: center;
    }
    
    .bold {
      font-weight: bold;
    }
    
    .line {
      border-bottom: 1px dashed #000;
      margin: 3mm 0;
    }
    
    .section {
      margin-bottom: 2mm;
    }
    
    .row {
      display: flex;
      justify-content: space-between;
      margin-bottom: 1mm;
    }
    
    .label {
      font-weight: bold;
    }
    
    .value {
      text-align: right;
    }
    
    .firma-section-single {
      margin-top: 8mm;
      display: flex;
      justify-content: center;
      text-align: center;
    }
    
    .firma-section-single .firma-box {
      width: 70%;
      display: flex;
      flex-direction: column;
      align-items: center;
    }
    
    .firma-line {
      border-top: 1px solid #000;
      width: 100%;
      margin-top: 15mm;
      margin-bottom: 2mm;
    }
    
    .firma-img {
      display: block;
      width: auto;
      max-width: 100%;
      height: auto;
      max-height: 15mm;
      object-fit: contain;
      margin: 0 auto 1mm auto;
    }
    
    .small {
      font-size: 8pt;
    }
    
    .header {
      margin-bottom: 3mm;
    }
    
    .logo {
      width: 30mm;
      height: auto;
      margin: 2mm auto;
      display: block;
      filter: grayscale(100%);
    }
    
    .producto-destacado {
      font-size: 11pt;
      font-weight: bold;
      margin: 2mm 0;
    }
    
    .cantidad-box {
      border: 2px solid #000;
      padding: 2mm 3mm;
      margin: 3mm 0;
      text-align: center;
    }
    
    .tipo-maquina-izquierda {
      margin-top: 1mm;
      margin-bottom: 1mm;
    }
    
    .tipo-maquina-izquierda .label {
      font-weight: bold;
      display: block;
    }
    
    .numero-guia {
      margin-top: 1mm;
      font-size: 11pt;
    }
    
        
    .firma-label {
      font-weight: normal;
      margin-bottom: 0.5mm;
    }
    
    .firma-rol {
      font-weight: normal;
    }
    @media print {
      body {
        width: 58mm;
      }
      
      .no-print {
        display: none;
      }
    }
  </style>
</head>
<body>
  <div class="voucher">
    <!-- LOGO -->
    <div class="center">
      <img src="${MPF_LOGO_BASE64}" alt="MPF Logo" class="logo">
    </div>
    
    <!-- ENCABEZADO -->
    <div class="header center">
      <div class="bold">MPF INGENIERIA CIVIL SPA</div>
      <div class="small">RUT: 77.158.216-8</div>
    </div>
    
    <div class="center bold">
      GUIA DE DESPACHO
    </div>
    <div class="center bold numero-guia">
      N° ${numeroGuia}
    </div>
    
    <div class="line"></div>
    
    <!-- DATOS DEL CLIENTE -->
    <div class="section">
      <div class="bold">EMPRESA:</div>
      <div>${empresaInfo?.nombre || projectName || 'N/A'}</div>
      <div class="row">
        <span class="label">RUT:</span>
        <span>${empresaInfo?.rut || 'N/A'}</span>
      </div>
    </div>
    
    <div class="line"></div>
    
    <!-- RECEPTOR -->
    <div class="section">
      <div class="bold">RECEPTOR</div>
      <div class="row">
        <span class="label">Nombre:</span>
        <span>${formatNombreCorto(operadorInfo?.nombre)}</span>
      </div>
      <div class="row">
        <span class="label">Run:</span>
        <span>${formatRun(operadorInfo?.rut)}</span>
      </div>
      <div class="tipo-maquina-izquierda">
        <div class="label">Tipo Maquina:</div>
        <div>${machineInfo?.type || machineInfo?.nombre || 'N/A'}</div>
      </div>
      <div class="row">
        <span class="label">Maquina:</span>
        <span class="bold">${machineInfo?.code || machineInfo?.patente || 'N/A'}</span>
      </div>
    </div>
    
    <div class="line"></div>
    
    <!-- REPARTIDOR / EQUIPO SURTIDOR -->
    <div class="section">
      <div class="bold">REPARTIDOR</div>
      <div class="row">
        <span class="label">Nombre:</span>
        <span>${formatNombreCorto(repartidorInfo?.nombre)}</span>
      </div>
      <div class="row">
        <span class="label">Run:</span>
        <span>${formatRun(repartidorInfo?.rut)}</span>
      </div>
      ${equipoSurtidorInfo ? `
      <div class="row">
        <span class="label">Equipo:</span>
        <span>${equipoSurtidorInfo.patente || equipoSurtidorInfo.code || 'N/A'}</span>
      </div>
      <div class="row">
        <span class="label">Desc:</span>
        <span>${equipoSurtidorInfo.name || equipoSurtidorInfo.nombre || ''}</span>
      </div>` : ''}
    </div>
    
    <div class="line"></div>
    
    <!-- FECHA Y HORA -->
    <div class="section">
      <div class="row">
        <span class="label">Fecha Emision:</span>
        <span>${fechaFormateada}</span>
      </div>
      <div class="row">
        <span class="label">Hora Emision:</span>
        <span>${hora}</span>
      </div>
    </div>
    
    <div class="line"></div>
    
    <div class="line"></div>
    
    <!-- PRODUCTO -->
    <div class="section">
      <div class="row">
        <span class="label">Producto:</span>
        <span>DIESEL</span>
      </div>
    </div>
    
    <!-- CANTIDAD CON BORDE -->
    <div class="cantidad-box">
      <span class="label">Cantidad:</span>
      <span class="bold">${cantidadFormateada} Lts</span>
    </div>
    
    <div class="line"></div>
    
    ${firmasSectionHTML}
    
    <!-- BOTÓN PARA IMPRIMIR (solo visible en pantalla) -->
    <div class="no-print" style="margin-top: 10mm; text-align: center;">
      <button onclick="window.print()" style="padding: 10px 20px; font-size: 14px; cursor: pointer; background: #4CAF50; color: white; border: none; border-radius: 5px;">
        🖨️ IMPRIMIR VOUCHER
      </button>
    </div>
  </div>
</body>
</html>
  `.trim();

  return voucherHTML;
}

/**
 * Abre el voucher en una nueva ventana para imprimir
 * @param {Object} params - Parámetros del voucher
 */
export function printThermalVoucher(params) {
  const html = generateThermalVoucher(params);
  
  // Crear una nueva ventana
  const printWindow = window.open('', '_blank', 'width=400,height=600');
  
  if (!printWindow) {
    alert('Por favor permite las ventanas emergentes para imprimir el voucher');
    return;
  }
  
  // Escribir el HTML en la nueva ventana
  printWindow.document.write(html);
  printWindow.document.close();
  
  // Esperar a que cargue y luego abrir el diálogo de impresión
  printWindow.onload = function() {
    setTimeout(() => {
      printWindow.print();
    }, 250);
  };
}

/**
 * Obtiene el siguiente número de guía correlativo
 * @returns {Promise<number>} Siguiente número correlativo
 */
export async function getNextGuiaNumber() {
  try {
    // Importar Firestore dinámicamente para evitar problemas de circular dependency
    const { collection, query, orderBy, limit, getDocs, addDoc } = await import('firebase/firestore');
    const { db } = await import('../lib/firebase');
    
    // Obtener el último número de guía de la colección
    const guiasRef = collection(db, 'guias_despacho');
    const q = query(guiasRef, orderBy('numeroGuia', 'desc'), limit(1));
    const snapshot = await getDocs(q);
    
    let nextNumber = 1;
    
    if (!snapshot.empty) {
      const lastGuia = snapshot.docs[0].data();
      nextNumber = (lastGuia.numeroGuia || 0) + 1;
    }
    
    // Guardar el nuevo número en la colección para mantener el correlativo
    await addDoc(guiasRef, {
      numeroGuia: nextNumber,
      fechaCreacion: new Date().toISOString()
    });
    
    return nextNumber;
  } catch (error) {
    console.error('Error obteniendo número de guía:', error);
    // En caso de error, retornar un número basado en timestamp para evitar duplicados
    return parseInt(Date.now().toString().slice(-6));
  }
}

/**
 * Genera el voucher como texto plano (alternativa para impresoras ESC/POS)
 * @param {Object} params - Parámetros del voucher
 * @returns {string} Texto del voucher
 */
export function generateThermalVoucherText({ 
  reportData, 
  projectName, 
  machineInfo, 
  operadorInfo,
  empresaInfo,
  repartidorInfo,
  equipoSurtidorInfo,
  numeroGuiaCorrelativo
}) {
  const numeroGuia = numeroGuiaCorrelativo 
    ? numeroGuiaCorrelativo.toString().padStart(3, '0')
    : (reportData.numeroReporte ? reportData.numeroReporte.split('-').pop() : '001');

  const formatDate = (dateStr) => {
    try {
      const [year, month, day] = dateStr.split('-');
      return `${day}/${month}/${year}`;
    } catch (e) {
      return dateStr;
    }
  };

  const formatCantidad = (cantidad) => {
    if (!cantidad) return '0';
    const num = parseFloat(cantidad);
    return num.toLocaleString('es-CL', { 
      minimumFractionDigits: 0,
      maximumFractionDigits: 2 
    });
  };

  const hora = reportData.hora || new Date().toLocaleTimeString('es-CL', { 
    hour: '2-digit', 
    minute: '2-digit',
    hour12: false 
  });

  const fechaFormateada = formatDate(reportData.fecha || '');
  const cantidadFormateada = formatCantidad(reportData.cantidadLitros);
  
  const line = '--------------------------------';
  
  return `
  MPF INGENIERIA CIVIL SPA
      RUT: 77.158.216-8
      
  GUIA DE DESPACHO N° ${numeroGuia}
${line}

EMPRESA:
${empresaInfo?.nombre || projectName || 'N/A'}
RUT: ${empresaInfo?.rut || 'N/A'}

Tipo Maquina: ${machineInfo?.type || machineInfo?.nombre || 'N/A'}
Maquina: ${machineInfo?.code || machineInfo?.patente || 'N/A'}
${line}

Fecha Emision: ${fechaFormateada}
Hora Emision: ${hora}
${line}

${line}

Producto: DIESEL
Cantidad: ${cantidadFormateada} Lts
${line}





         FIRMA RECEPTOR
`.trim();
}
